import React from "react";

const CollegeTable = ({ colleges }) => {
    return (
        <table>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Place</th>
                    <th>NIRF Rank</th>
                    <th>Cutoff</th>
                    <th>Placements</th>
                </tr>
            </thead>
            <tbody>
                {colleges.map((college) => (
                <tr key={college._id}>
                    <td>{college.name}</td>
                    <td>{college.place}</td>
                    <td>{college.nirfRank}</td>
                    <td>{college.cutoff}</td>
                    <td>{college.placements}</td>
                </tr>
                ))}
            </tbody>

        </table>
    );
};

export default CollegeTable;
